import React from "react";


const NavItem: React.FC<{ item: string; onClick: () => void }> = ({ item, onClick }) => {
  return (
    <li className="nav-item btn btn-danger " onClick={onClick}>
      {item}
    </li>
  );
};

export default NavItem;
